import React, { Component, Fragment } from "react";
import { connect } from "react-redux";
import PropTypes from "prop-types";
import { addClos, getClos, deleteClos } from "../../actions/clos";
export class Clos extends Component {
  state = {
    code: "",
    description: ""
  };
  static propTypes = {
    clos: PropTypes.array.isRequired,
    getClos: PropTypes.func.isRequired,
    deleteClos: PropTypes.func.isRequired
  };
  //component load then
  componentDidMount() {
    this.props.getClos();
  }
  render() {
    return (
      <div>
        <h1>Add CLO</h1>
        <form onSubmit={this.onSubmit}>
          <div className="form-group">
            <label>code</label>
            <input
              className="form-control"
              type="text"
              name="code"
              onChange={this.onChange}
              value={code}
            ></input>
          </div>
          <div className="form-group">
            <label>Description</label>
            <input
              className="form-control"
              type="text"
              name="description"
              onChange={this.onChange}
              value={description}
            ></input>
          </div>
          <div className="form-group">
            <button type="submit" className="btn btn-primary">
              Submit
            </button>
          </div>
        </form>
      </div>
    );
  }
}

//state of redux
const mapStateToProps = state => ({
  clos: state.clos.clos
});
export default connect(mapStateToProps, { addClos, getClos, deleteClos })(Clos);
